import { createTheme } from '@mui/material/styles';

export const theme = createTheme({
    palette: {
      primary: {
        main: 'rgb(128,128,128)',
      },
      secondary: {
        main: 'rgb(0,0,0)',
      },
    },
    iconButton : {
      size:"large",
      edge:"start",
      color:"inherit",
      ariaLabel:"menu",
      sx: "mr:2",
    }

  });
